INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 125801, 24001, "リリ", 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 321, 1, 1);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 126001, 24001, "クリア", 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 322, 1, 2);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 126101, 24001, "プレシア", 0, "んーと。\nこれ、あげる。\nはい", 2, 323, 1, 3);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 125801, 24001, "リリ", 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 324, 2, 4);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 126001, 24001, "クリア", 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 2, 5);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (40011, 1, 126101, 24001, "プレシア", 0, "お兄。\nきてくれて、うれしい", 2, 326, 2, 6);
